import 'weather-icons/cs/weather-icons.css';
import "../App.css";


const WeatherWidget = () =>{
    return(
        <div className="container">
            <div className="card">
              <h1>Ahmedabad</h1>
              <h5 className='py-4'>
                <i class="wi wi-day-sunny"></i>
              </h5>
            </div>
            
        </div>
    );
}

export default WeatherWidget;
